/* eslint-disable @typescript-eslint/restrict-plus-operands */
/* eslint-disable no-extra-boolean-cast */
import { ScheduleService } from './schedule.service';
import { Job, Week, WhichWeek, JobMode, JobGroup } from './schedule.model';
import {Component, OnDestroy, OnInit, Output} from '@angular/core';
import {Alert, AlertService} from 'app/core/util/alert.service';
import { Router, ActivatedRoute } from '@angular/router';
import { Observable, Subscription } from 'rxjs';
import {HttpHeaders, HttpResponse} from '@angular/common/http';
import { CodeView, IcCodeService } from 'app/ng-connect';
import { ConfirmationService } from 'primeng/api';
import { EventManager } from 'app/core/util/event-manager.service';

@Component({
  selector: 'ic-schedule-maintain',
  templateUrl: './schedule-maintain.component.html',
  styleUrls: ['./schedule-maintain.component.scss'],
})
export class ScheduleMaintainComponent implements OnInit {
  public JOB_MODE = JobMode;
  public JOB_GROUP = JobGroup;

  public DEACTIVATED = 'D';
  public ACTIVATED = 'A';

  public job?: Job;
  public dialogShow?: boolean;
  public blocked?: boolean;

  public fromSec?: number;
  public fromMin?: number;
  public fromHour?: number;
  public fromDay?: number;
  public fromMonth?: number;
  public fromWeek?: number;
  public fromYear?: number;

  public toSec?: number;
  public toMin?: number;
  public toHour?: number;
  public toDay?: number;
  public toMonth?: number;
  public toWeek?: number;
  public toYear?: number;

  public secSelect?: string;
  public minSelect?: string;
  public hourSelect?: string;
  public daySelect?: string;
  public monthSelect?: string;
  public weekSelect?: string;
  public yearSelect?: string;

  public startSec?: number;
  public startMin?: number;
  public startHour?: number;
  public startDay?: number;
  public startMonth?: number;
  public weekOfMonth?: number;

  public everySec?: number;
  public everyMin?: number;
  public everyHour?: number;
  public everyDay?: number;
  public everyMonth?: number;
  public dayOfWeek?: number;

  public designatedsSec?: any[];
  public designatedsMin?: any[];
  public designatedsHour?: any[];
  public designatedsDay?: any[];
  public designatedsMonth?: any[];
  public designatedsWeek?: any[];

  public designatedSec?: number[];
  public designatedMin?: number[];
  public designatedHour?: number[];
  public designatedDay?: number[];
  public designatedMonth?: number[];
  public designatedWeek?: number[];

  public perDay?: number;
  public lastDayOfWeek?: number;
  public whichWeek?: number;

  public dayOfWeeks?: any[];
  public whichWeeks?: any[];
  public minYear?: number;

  public cron?: string;
  public cronValid?: boolean;

  public readonly?: boolean;

  public jobList?: CodeView[];
  public jobParamList?: CodeView[];

  public alert?: Alert;
  public today = new Date();

  public runTime?: string[];
  private ANY = '*';
  private NOT_SPECIFY = '?';
  private SPACE = ' ';

  constructor(
    private scheduleService: ScheduleService,
    private alertService: AlertService,
    private confirmationService: ConfirmationService,
    private codeService: IcCodeService,
    private router: Router,
    private activatedRoute: ActivatedRoute
  ) {}

  ngOnInit(): void {
    this.codeService.gets('batch_job').subscribe((codes: any[]) => {
      this.jobList = codes[0];
    });
    this.codeService.gets('batch_job_param').subscribe((codes: any[]) => {
      this.jobParamList = codes[0];
    });
    this.activatedRoute.params.subscribe(params => {
      this.readonly = params['readonly'] === '1';
      if (params['id']) {
        this.scheduleService.find(params['id']).subscribe(res => {
          this.job = res;
          this.job.startDt = new Date(this.job.startDt as any);
          if (this.job.endDt) {
            this.job.endDt = new Date(this.job.endDt as any);
          }
        });
      } else {
        this.job = new Job();
        this.job.mode = this.JOB_MODE[0].value;
        this.job.group = this.JOB_GROUP[0].value;
        this.job.parameter = 'processDate=TODAY;';
      }
    });
    this.initData();
    this.chageCron();
  }

  public confirmUpdateJob(): void {
    this.confirmationService.confirm({
      message: 'Are you sure that you want to update this job?',
      header: 'Confirmation',
      icon: 'pi pi-exclamation-triangle',
      accept: () => {
        this.save();
      },
    });
  }

  public confirmStopJob(name: string, group: string): void {
    this.confirmationService.confirm({
      message: 'Are you sure that you want to stop this Job?',
      header: 'Confirmation',
      icon: 'pi pi-exclamation-triangle',
      accept: () => {
        this.stopJob(name, group);
      },
    });
  }

  public stopJob(name: string, group: string): void {
    this.scheduleService.stopJob(name, group).subscribe(
      (res) => {
        // this.loadAll();
        this.setAlert(res.headers);
        this.goToSearchPage();
      },
      error => {
        this.onError(error);
      }
    );
  }

  public confirmStartJob(name: string, group: string): void {
    this.confirmationService.confirm({
      message: 'Are you sure that you want to start this job?',
      header: 'Confirmation',
      icon: 'pi pi-exclamation-triangle',
      accept: () => {
        this.startJob(name, group);
      },
    });
  }

  public startJob(name: string, group: string): void {
    this.scheduleService.startJob(name, group).subscribe(
      (res) => {
        // this.loadAll();
        this.setAlert(res.headers);
        this.goToSearchPage();
      },
      error => {
        this.onError(error);
      }
    );
  }

  public confirmDeleteJob(id: string, name: string, group: string): void {
    this.confirmationService.confirm({
      message: 'Are you sure that you want to delete the Job of [ name : ' + name + '  , group : ' + group + ' ]?',
      header: 'Confirmation',
      icon: 'pi pi-exclamation-triangle',
      accept: () => {
        this.scheduleService.delete(id, name).subscribe(
          (res) => {
            this.setAlert(res.headers);
            this.goToSearchPage();
          },
          error => {
            this.onError(error);
          }
        );
      },
    });
  }

  public block(isTrue: boolean): void {
    this.blocked = isTrue;
  }

  public showDialog(): void {
    if (this.job?.cron) {
      this.cron = this.job.cron;
    }
    this.dialogShow = true;
    this.getCronRunTime();
  }

  public getDayOfWeekName(value: number): string {
    return this.dayOfWeeks[value - 1].label as string;
  }

  public getCronRunTime(): void {
    this.scheduleService.getRunTime(this.cron).subscribe(
      (res: string[]) => {
        if (res.length) {
          this.cronValid = true;
          this.runTime = res;
        } else {
          this.cronValid = false;
        }
      },
      (error: any) => {
        this.onError(error);
      }
    );
  }

  public save(): void {
    this.subscribeToSaveResponse(this.job.status ? this.scheduleService.update(this.job) : this.scheduleService.create(this.job));
  }

  public cancel(): void {
    this.goToSearchPage();
  }

  public confirmCron(): void {
    this.scheduleService.cronIsValid(this.cron).subscribe((res: any) => {
      if (res) {
        this.dialogShow = false;
        this.job.cron = this.cron;
      } else {
        this.showCronInvalid();
      }
    });
  }

  public chageCron(): void {
    let sec = '';
    let min = '';
    let hour = '';
    let day = '';
    let month = '';
    let week = '';
    let year = '';

    /**
     * Second
     */
    switch (this.secSelect) {
      case '1':
        sec = this.ANY;
        break;
      case '2':
        sec = this.fromSec + '-' + this.toSec;
        break;
      case '3':
        sec = this.startSec + '/' + this.everySec;
        break;
      case '4':
        if (this.designatedSec?.length && this.designatedSec.length !== this.designatedsMin?.length) {
          this.designatedSec.forEach((value: number, index: number, array: number[]) => {
            if (index !== array.length - 1) {
              sec += value + ',';
            } else {
              sec += value;
            }
          });
        } else {
          sec = this.ANY;
        }
        break;
    }

    /**
     * Minuite
     */
    switch (this.minSelect) {
      case '1':
        min = this.ANY;
        break;
      case '2':
        min = this.fromMin + '-' + this.toMin;
        break;
      case '3':
        min = this.startMin + '/' + this.everyMin;
        break;
      case '4':
        if (this.designatedMin?.length && this.designatedMin.length !== this.designatedsMin?.length) {
          this.designatedMin.forEach((value: number, index: number, array: number[]) => {
            if (index !== array.length - 1) {
              min += value + ',';
            } else {
              min += value;
            }
          });
        } else {
          min = this.ANY;
        }
        break;
    }

    /**
     * Hour
     */
    switch (this.hourSelect) {
      case '1':
        hour = this.ANY;
        break;
      case '2':
        hour = this.fromHour + '-' + this.toHour;
        break;
      case '3':
        hour = this.startHour + '/' + this.everyHour;
        break;
      case '4':
        if (this.designatedHour?.length && this.designatedHour.length !== this.designatedsHour?.length) {
          this.designatedHour.forEach((value: number, index: number, array: number[]) => {
            if (index !== array.length - 1) {
              hour += value + ',';
            } else {
              hour += value;
            }
          });
        } else {
          hour = this.ANY;
        }
        break;
    }

    /**
     * Day
     */
    if (this.weekSelect === '1') {
      switch (this.daySelect) {
        case '1':
          day = this.ANY;
          break;
        case '2':
          day = this.NOT_SPECIFY;
          break;
        case '3':
          day = this.fromDay + '-' + this.toDay;
          break;
        case '4':
          day = this.startDay + '/' + this.everyDay;
          break;
        case '5':
          day = this.perDay + 'W';
          break;
        case '6':
          day = 'L';
          break;
        case '7':
          if (this.designatedDay?.length && this.designatedDay.length !== this.designatedsDay?.length) {
            this.designatedDay.forEach((value: number, index: number, array: number[]) => {
              if (index !== array.length - 1) {
                day += value + ',';
              } else {
                day += value;
              }
            });
          } else {
            day = this.ANY;
          }
      }
    } else {
      day = this.NOT_SPECIFY;
    }

    /**
     * Month
     */

    switch (this.monthSelect) {
      case '1':
        month = this.ANY;
        break;
      case '2':
        month = this.NOT_SPECIFY;
        break;
      case '3':
        month = this.fromMonth + '-' + this.toMonth;
        break;
      case '4':
        month = this.startMonth + '/' + this.everyMonth;
        break;
      case '5':
        if (this.designatedMonth?.length && this.designatedMonth.length !== this.designatedsMonth?.length) {
          this.designatedMonth.forEach((value: number, index: number, array: number[]) => {
            if (index !== array.length - 1) {
              month += value + ',';
            } else {
              month += value;
            }
          });
        } else {
          month = this.ANY;
        }
        break;
    }

    /**
     * Week
     */
    if (this.daySelect === '2') {
      switch (this.weekSelect) {
        case '1':
          week = this.NOT_SPECIFY;
          break;
        case '2':
          week = this.ANY;
          break;
        case '3':
          week = this.fromWeek + '-' + this.toWeek;
          break;
        case '4':
          week = this.whichWeek + '#' + this.dayOfWeek;
          break;
        case '5':
          week = this.lastDayOfWeek + 'L';
          break;
        case '6':
          if (this.designatedWeek?.length && this.designatedWeek.length !== this.designatedsWeek?.length) {
            this.designatedWeek.forEach((value: number, index: number, array: number[]) => {
              if (index !== array.length - 1) {
                week += value + ',';
              } else {
                week += value;
              }
            });
          } else {
            week = this.ANY;
          }
          break;
      }
    } else {
      week = this.NOT_SPECIFY;
    }

    /**
     * Year
     */
    switch (this.yearSelect) {
      case '1':
        year = '';
        break;
      case '2':
        year = this.ANY;
        break;
      case '3':
        year = this.fromYear + '-' + this.toYear;
        break;
    }

    this.cron = sec + this.SPACE + min + this.SPACE + hour + this.SPACE + day + this.SPACE + month + this.SPACE + week + this.SPACE + year;

    this.getCronRunTime();
  }

  private generatorData(): void {
    for (let i = 0; i < 60; i++) {
      if (i !== 0) {
        if (i < 32) {
          this.designatedsDay?.push({ label: i, value: i });
        }
        if (i < 13) {
          this.designatedsMonth?.push({ label: i, value: i });
        }
      }
      if (i < 24) {
        this.designatedsHour?.push({ label: i, value: i });
      }
      this.designatedsSec?.push({ label: i, value: i });
      this.designatedsMin?.push({ label: i, value: i });
    }
  }

  private subscribeToSaveResponse(result: Observable<HttpResponse<any>>): void {
    result.subscribe(
      (res: HttpResponse<any>) => this.onSaveSuccess(res),
      (res: HttpResponse<any>) => this.onSaveError(res)
    );
  }

  private onSaveSuccess(res: any): void {
    this.setAlert(res.headers);
    this.goToSearchPage();
  }

  private onSaveError(error: any): void {
    this.setAlert();
    const appDialogErrorMsg = error.headers.get('X-Nspay2App-alert');
    document.getElementById('appDialogErrorMsg')!.innerHTML = appDialogErrorMsg;
    document.getElementById('appDialogErrorMsg')!.style.display = 'block';
  }

  private onError(error: any): void {
    this.setAlert();
    this.alertService.addAlert({ type: 'danger',
      translationKey: error.headers.get('X-Nspay2App-alert'),
      translationParams: {param: error.headers.get('X-Nspay2App-params')}});
  }

  private goToSearchPage(): void {
    this.router.navigate(['/admin/schedule'], {state: { data: this.alert }});
  }

  private showCronInvalid(): void {
    this.cronValid = false;
    setTimeout(() => {
      this.cronValid = true;
    }, 3000);
  }

  private setAlert(header?: HttpHeaders): void {
    if (header) {
      this.alert = { type: 'success',
        translationKey: header.get('X-Nspay2App-alert')!,
        translationParams: {param: header.get('X-Nspay2App-params')}};
    } else {
      this.alert = undefined;
    }
  }

  private initData(): void {
    this.fromSec = 0;
    this.toSec = 1;
    this.startSec = 0;
    this.everySec = 1;
    this.designatedsSec = [];
    this.secSelect = '1';

    this.fromMin = 0;
    this.toMin = 1;
    this.startMin = 0;
    this.everyMin = 1;
    this.designatedsMin = [];
    this.minSelect = '1';

    this.fromHour = 0;
    this.toHour = 1;
    this.startHour = 0;
    this.everyHour = 1;
    this.designatedsHour = [];
    this.hourSelect = '1';

    this.fromDay = 1;
    this.toDay = 2;
    this.startDay = 1;
    this.everyDay = 1;
    this.designatedsDay = [];
    this.daySelect = '1';
    this.perDay = 1;

    this.fromMonth = 1;
    this.toMonth = 2;
    this.startMonth = 1;
    this.everyMonth = 1;
    this.designatedsMonth = [];
    this.monthSelect = '1';

    this.fromWeek = 1;
    this.toWeek = 2;
    this.weekOfMonth = 1;
    this.dayOfWeek = 0;
    this.designatedsWeek = [];
    this.weekSelect = '1';
    this.lastDayOfWeek = 0;
    this.whichWeek = 1;
    this.dayOfWeeks = Week;
    this.designatedsWeek = Week;
    this.whichWeeks = WhichWeek;

    this.minYear = new Date().getFullYear();
    this.fromYear = this.minYear;
    this.toYear = this.minYear + 1;
    this.yearSelect = '1';

    this.cronValid = true;

    this.generatorData();
  }
}
<div *ngIf="job">
  <h2 *ngIf="!readonly!">
    <span *ngIf="!job?.id!" icTranslate="schedule.create.title">Create Schedule</span>
    <span *ngIf="job?.id!" icTranslate="schedule.maintain.title">Maintain Schedule</span>
  </h2>
  <h2 *ngIf="readonly!">
    <span icTranslate="schedule.view.title">View Schedule</span>
  </h2>
  <p id="appDialogErrorMsg" class="alert-dismissible alert-danger alert"></p>
  <ic-alert></ic-alert>
  <br />
  <div class="row">
    <div class="col-sm-12">
      <form id="maintainScheduleForm" name="maintainScheduleForm" role="form"  #maintainScheduleForm="ngForm">
        <div class="card">
          <div class="card-header">
            <span icTranslate="schedule.home.detail">Schedule Detail</span>
          </div>

          <div class="rounded-pill row">
            <label class="col-sm-2 form-control-label">
              <span icTranslate="schedule.home.name">Schedule Name</span>
            </label>
            <div class="col-sm-4" [ngClass]="readonly! ? 'borders' : ''">
              <div *ngIf="readonly!; then nameRead; else nameEdit"></div>
              <ng-template #nameEdit>
                <select class="form-select" id="name" name="name"  [(ngModel)]="job.name" [required]="true">
                  <option [ngValue]="job.codeId" *ngFor="let job of jobList">{{job.label | icCodeI18n}}</option>
                </select>
                <div [hidden]="!(maintainScheduleForm.controls.name?.dirty && maintainScheduleForm.controls.name?.invalid)">
                  <small
                    class="form-text text-danger"
                    [hidden]="!maintainScheduleForm.controls.name?.errors?.required"
                    icTranslate="entity.validation.required"
                  >
                    This field is required.
                  </small>
                </div>
              </ng-template>
              <ng-template #nameRead>
                <label class="read">{{ job.name }}</label>
              </ng-template>
            </div>
<!--
            <label class="col-sm-2 form-control-label">
              <span icTranslate="schedule.home.group">Schedule Group</span>
            </label>
            <div class="col-sm-4" [ngClass]="readonly ? 'borders' : ''">
              <div *ngIf="readonly!; then groupRead; else groupEdit"></div>
              <ng-template #groupEdit>
                <input
                  type="text"
                  class="form-control"
                  [(ngModel)]="job.group"
                  name="group"
                  id="group"
                  autoDisplayFirst="false"
                  [required]="true"
                />
                <div [hidden]="!(maintainScheduleForm.controls.scheduleType?.dirty && maintainScheduleForm.controls.scheduleType?.invalid)">
                  <small
                    class="form-text text-danger"
                    [hidden]="!maintainScheduleForm.controls.scheduleType?.errors?.required"
                    icTranslate="entity.validation.required"
                  >
                    This field is required.
                  </small>
                </div>
              </ng-template>
              <ng-template #groupRead>
                <label class="read">{{ job.group }}</label>
              </ng-template>
            </div>
          -->
            <label class="col-sm-2 form-control-label">
              <span icTranslate="schedule.home.group">Schedule Group</span>
            </label>
            <div class="col-sm-4" [ngClass]="readonly ? 'borders' : ''">
              <div *ngIf="readonly!; then groupRead; else groupEdit"></div>
              <ng-template #groupEdit>
                <p-dropdown [options]="JOB_GROUP" [(ngModel)]="job.group" name="group" [style]="{ width: '100%' }"></p-dropdown>
              </ng-template>
              <ng-template #groupRead>
                <label class="read">{{ job.group }}</label>
              </ng-template>
            </div>

          </div>

          <div class="rounded-pill row">
            <label class="col-sm-2 form-control-label"><span icTranslate="schedule.home.cron">Schedule Cron</span></label>
            <div class="col-sm-4" [ngClass]="readonly ? 'borders' : ''">
              <div *ngIf="readonly!; then cronRead; else cronEdit"></div>
              <ng-template #cronEdit>
                <input
                  type="text"
                  (click)="showDialog()"
                  readonly
                  class="form-control"
                  [(ngModel)]="job.cron"
                  id="cron"
                  name="cron"
                  maxlength="255"
                  [required]="true"
                />
              </ng-template>
              <ng-template #cronRead>
                <label class="read">{{ job.cron }}</label>
              </ng-template>
            </div>

            <label class="col-sm-2 form-control-label"><span icTranslate="schedule.home.jobStatus">Job Status</span></label>
            <div class="col-sm-4" [ngClass]="readonly ? 'borders' : ''">
<!--              <label class="read">{{ job.status }}</label>-->
              <div [ngSwitch]="job.status">
                <span *ngSwitchCase="ACTIVATED">
                  <label class="read">Enabled</label>
                </span>
                <span *ngSwitchCase="DEACTIVATED">
                  <label class="read">Disabled</label>
                </span>
              </div>
            </div>
          </div>

          <div class="rounded-pill row">
            <label class="col-sm-2 form-control-label"><span icTranslate="schedule.home.startDt">Effective Start Date</span></label>
            <div class="col-sm-4" [ngClass]="readonly ? 'borders' : ''">
              <div *ngIf="readonly!; then startDtRead; else startDtEdit"></div>
              <ng-template #startDtEdit>
                <p-calendar
                  [(ngModel)]="job.startDt"
                  [minDate]="today"
                  [maxDate]="job.endDt!"
                  dateFormat="yy-mm-dd"
                  inputId="startDt"
                  [readonlyInput]="true"
                  name="startDt"
                  [required]="true"
                ></p-calendar>
              </ng-template>
              <ng-template #startDtRead>
                <label class="read">{{ job.startDt | date: 'yyyy-MM-dd' }}</label>
              </ng-template>
            </div>

            <label class="col-sm-2 form-control-label"><span icTranslate="schedule.home.endDt">Effective End Date</span></label>
            <div class="col-sm-4" [ngClass]="readonly ? 'borders' : ''">
              <div *ngIf="readonly!; then endDtRead; else endDtEdit"></div>
              <ng-template #endDtEdit>
                <p-calendar
                  [(ngModel)]="job.endDt"
                  [minDate]="job.startDt!"
                  dateFormat="yy-mm-dd"
                  inputId="endDt"
                  [readonlyInput]="true"
                  name="endDt"
                ></p-calendar>
              </ng-template>
              <ng-template #endDtRead>
                <label class="read">{{ job.endDt | date: 'yyyy-MM-dd' }}</label>
              </ng-template>
            </div>
          </div>

          <div class="rounded-pill row">
            <label class="col-sm-2 form-control-label"><span icTranslate="schedule.home.description">Schedule Description</span></label>
            <div class="col-sm-10" [ngClass]="readonly ? 'borders' : ''">
              <div *ngIf="readonly!; then descriptionRead; else descriptionEdit"></div>
              <ng-template #descriptionEdit>
                <input type="text" class="form-control" [(ngModel)]="job.description" id="description" name="description" maxlength="255" />
              </ng-template>
              <ng-template #descriptionRead>
                <label class="read">{{ job.description }}</label>
              </ng-template>
            </div>
          </div>

          <div class="rounded-pill row">
            <label class="col-sm-2 form-control-label">
              <span icTranslate="schedule.home.parameter">Job Parameter </span>
              <button type="button" class="btn btn-info btn-sm" placement="bottom" [ngbTooltip]="paramList" triggers="click:blur">
                <fa-icon [icon]="'info-circle'"></fa-icon>
              </button>
              <ng-template #paramList>
                <div *ngFor="let jobParam of jobParamList">
                  <span>{{jobParam.codeId}}: {{jobParam.label | icCodeI18n}}</span>
                </div>
              </ng-template>
            </label>
            <div class="col-sm-10" [ngClass]="readonly ? 'borders' : ''">
              <div *ngIf="readonly!; then parameterRead; else parameterEdit"></div>
              <ng-template #parameterEdit>
                <input type="text" class="form-control" pattern="^([^=;\s]+={1}[^=;\s]+;)*$" [(ngModel)]="job.parameter" id="parameter" name="parameter" maxlength="255" />
                <div [hidden]="!maintainScheduleForm.controls.parameter?.invalid">
                  <small class="form-text text-danger">
                    Pattern validation failed.
                  </small>
                </div>
                <small id="parameterHelp" class="form-text text-muted">Please use key=value format separate by semicolon(;)
                  e.g. foo=bar;foo2=bar2;</small>
              </ng-template>
              <ng-template #parameterRead>
                <label class="read">{{ job.parameter }}</label>
              </ng-template>
            </div>
          </div>
        </div>

        <div style="margin-top: 20px" *ngIf="!readonly!">
          <button class="btn btn-secondary btn-sm" (click)="cancel()">
            <fa-icon [icon]="'ban'"></fa-icon>&nbsp;<span icTranslate="schedule.btn.cancel">Cancel</span>
          </button>
          <button *ngIf="job.id" type="submit" class="btn btn-danger btn-sm" (click)="confirmDeleteJob(job.id!, job.name!, job.group!)">
            <fa-icon [icon]="'times'"></fa-icon>
            <span class="hidden-md-down" icTranslate="schedule.btn.delete">Delete</span>
          </button>
          <button class="btn btn-warning btn-sm" *ngIf="job?.status === 'D'" (click)="confirmStartJob(job?.name!, job?.group!)"
            [disabled]="maintainScheduleForm.form.dirty">
            <fa-icon [icon]="'play'"></fa-icon>
            <span class="hidden-md-down" icTranslate="schedule.btn.start">Start</span>
          </button>
          <button class="btn btn-warning btn-sm" *ngIf="job?.status === 'A'" (click)="confirmStopJob(job.name!, job.group!)"
            [disabled]="maintainScheduleForm.form.dirty">
            <fa-icon [icon]="'stop'"></fa-icon>
            <span class="hidden-md-down" icTranslate="schedule.btn.stop">Stop</span>
          </button>
          <button
            id="saveBtn"
            *ngIf="!job?.status!"
            class="btn btn-primary btn-sm"
            [disabled]="maintainScheduleForm.form.invalid"
            (click)="save()"
          >
            <fa-icon [icon]="'save'"></fa-icon>&nbsp;<span icTranslate="schedule.btn.save">Save</span>
          </button>
          <button
            id="saveBtn"
            *ngIf="job?.status!"
            class="btn btn-primary btn-sm"
            [disabled]="maintainScheduleForm.form.invalid || job?.status === 'A'"
            (click)="confirmUpdateJob()"
          >
            <fa-icon [icon]="'save'"></fa-icon>&nbsp;<span icTranslate="schedule.btn.update">update</span>
          </button>
        </div>

        <div style="margin-top: 20px" *ngIf="readonly!">
          <button class="btn btn-secondary btn-sm" (click)="cancel()">
            <fa-icon [icon]="'ban'"></fa-icon>&nbsp;<span icTranslate="schedule.btn.back">Cancel</span>
          </button>
        </div>
      </form>
    </div>
  </div>
</div>
<!--p-blockUI [blocked]="blocked!"></p-blockUI-->
<p-dialog
  *ngIf="!readonly!"
  header="Create Cron"
  [(visible)]="dialogShow!"
  [style]="{ width: '70vw', position: 'relative' }"
  (onShow)="block(true)"
  (onHide)="block(false)"
  [baseZIndex]="10000"
>
  <div class="dialog-content">
    <p-tabView (click)="chageCron()">
      <p-tabPanel header="Example">
        <div class="row">
          <label class="col-sm-6 form-control-label text-center read">
            <span> Cron Structure</span>
          </label>
          <div class="col-sm-6 borders text-center">
            <label class="read"> second minute hour day month week year ("Year" can be omitted) </label>
          </div>
        </div>
        <hr />
        <div class="row">
          <label class="col-sm-7 form-control-label">
            <span>Executed at 10 am of every day</span>
          </label>
          <div class="col-sm-2 borders text-center">
            <label class="read"> 0 0 10 * * ? </label>
          </div>
        </div>
        <div class="row">
          <label class="col-sm-7 form-control-label">
            <span>Executed at 10 am on the first day of every month</span>
          </label>
          <div class="col-sm-2 borders text-center">
            <label class="read"> 0 0 10 1 * ? </label>
          </div>
        </div>
        <div class="row">
          <label class="col-sm-7 form-control-label">
            <span>Executed at 6:30 pm on the tuesday of every week</span>
          </label>
          <div class="col-sm-2 borders text-center">
            <label class="read"> 0 30 18 ? * 3 </label>
          </div>
        </div>
        <div class="row">
          <label class="col-sm-7 form-control-label">
            <span>Executed at 6 am every day from the 25th to the 29th of every month</span>
          </label>
          <div class="col-sm-2 borders text-center">
            <label class="read"> 0 0 6 25-29 * ? </label>
          </div>
        </div>
        <div class="row">
          <label class="col-sm-7 form-control-label">
            <span>Executed at 10 a.m on the nearest working day in 10th of May or 10th of March or 10th of April </span>
          </label>
          <div class="col-sm-2 borders text-center">
            <label class="read"> 0 0 10 10W 3,4,5 ? </label>
          </div>
        </div>
        <div class="new-item-badge">Base on Quartz</div>
      </p-tabPanel>
      <p-tabPanel header="Second">
        <div class="p-grid">
          <div class="p-col-12">
            <p-radioButton value="1" [(ngModel)]="secSelect"></p-radioButton>
            <label>Per second ,wildcards allowed [,-* /]</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="2" [(ngModel)]="secSelect"></p-radioButton>
            The cycle from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="fromSec" [min]="0" [max]="toSec! - 1" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;to&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="toSec" [min]="fromSec! + 1" [max]="59" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;seconds
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="3" [(ngModel)]="secSelect"></p-radioButton>
            Start from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="startSec" [min]="0" [max]="59" [showButtons]="true"></p-inputNumber>
            &nbsp;second,&nbsp;and every
            <p-inputNumber [(ngModel)]="everySec" [min]="1" [max]="59" [showButtons]="true"> </p-inputNumber>
            &nbsp;seconds to execute once
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="4" [(ngModel)]="secSelect"></p-radioButton>
            Designated&nbsp;&nbsp;
            <p-multiSelect [options]="designatedsSec!" [(ngModel)]="designatedSec" [maxSelectedLabels]="0" [style]="{ width: '200px' }">
            </p-multiSelect>
            <label *ngIf="!!designatedSec! && !!designatedSec?.length!">
              &nbsp;&nbsp;(&nbsp;
              <label *ngFor="let item of designatedSec; let i = index">
                {{ item }}
                <label *ngIf="i != designatedSec?.length! - 1"> &nbsp;,&nbsp; </label>
              </label>
              &nbsp;)&nbsp;&nbsp;
            </label>
          </div>
        </div>
      </p-tabPanel>
      <p-tabPanel header="Minute">
        <div class="p-grid">
          <div class="p-col-12">
            <p-radioButton value="1" [(ngModel)]="minSelect"></p-radioButton>
            <label>Per minute ,wildcards allowed [,-* /]</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="2" [(ngModel)]="minSelect"></p-radioButton>
            The cycle from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="fromMin" [min]="0" [max]="toMin! - 1" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;to&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="toMin" [min]="fromMin! + 1" [max]="59" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;minutes
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="3" [(ngModel)]="minSelect"></p-radioButton>
            Start from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="startMin" [min]="0" [max]="59" [showButtons]="true"></p-inputNumber>
            &nbsp;minute,&nbsp;and every
            <p-inputNumber [(ngModel)]="everyMin" [min]="1" [max]="59" [showButtons]="true"> </p-inputNumber>
            &nbsp;minutes to execute once
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="4" [(ngModel)]="minSelect"></p-radioButton>
            Designated&nbsp;&nbsp;
            <p-multiSelect [options]="designatedsMin!" [(ngModel)]="designatedMin" [maxSelectedLabels]="0" [style]="{ width: '200px' }">
            </p-multiSelect>
            <label *ngIf="!!designatedMin! && !!designatedMin?.length!">
              &nbsp;&nbsp;(&nbsp;
              <label *ngFor="let item of designatedMin; let i = index">
                {{ item }}
                <label *ngIf="i != designatedMin?.length! - 1"> &nbsp;,&nbsp; </label>
              </label>
              &nbsp;)&nbsp;&nbsp;
            </label>
          </div>
        </div>
      </p-tabPanel>
      <p-tabPanel header="Hour">
        <div class="p-grid">
          <div class="p-col-12">
            <p-radioButton value="1" [(ngModel)]="hourSelect"></p-radioButton>
            <label>Per Hour ,wildcards allowed [,-* /]</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="2" [(ngModel)]="hourSelect"></p-radioButton>
            The cycle from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="fromHour" [min]="0" [max]="toHour! - 1" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;to&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="toHour" [min]="fromHour! + 1" [max]="23" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;hours
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="3" [(ngModel)]="hourSelect"></p-radioButton>
            Start from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="startHour" [min]="0" [max]="23" [showButtons]="true"> </p-inputNumber>
            &nbsp;hour,&nbsp;and every
            <p-inputNumber [(ngModel)]="everyHour" [min]="1" [max]="23" [showButtons]="true"> </p-inputNumber>
            &nbsp;hours to execute once
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="4" [(ngModel)]="hourSelect"></p-radioButton>
            Designated&nbsp;&nbsp;
            <p-multiSelect [options]="designatedsHour!" [(ngModel)]="designatedHour" [maxSelectedLabels]="0" [style]="{ width: '200px' }">
            </p-multiSelect>
            <label *ngIf="!!designatedHour! && !!designatedHour?.length">
              &nbsp;&nbsp;(&nbsp;
              <label *ngFor="let item of designatedHour; let i = index">
                {{ item }}
                <label *ngIf="i != designatedHour?.length! - 1"> &nbsp;,&nbsp; </label>
              </label>
              &nbsp;)&nbsp;&nbsp;
            </label>
          </div>
        </div>
      </p-tabPanel>
      <p-tabPanel header="Day" [disabled]="weekSelect !== '1'">
        <div class="p-grid">
          <div class="p-col-12">
            <p-radioButton value="1" [(ngModel)]="daySelect"></p-radioButton>
            <label>Per Day ,wildcards allowed [,-* / L W]</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="2" [(ngModel)]="daySelect"></p-radioButton>
            <label>Not specify</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="3" [(ngModel)]="daySelect"></p-radioButton>
            The cycle from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="fromDay" [min]="1" [max]="toDay! - 1" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;to&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="toDay" [min]="fromDay! + 1" [max]="31" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;Days
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="4" [(ngModel)]="daySelect"></p-radioButton>
            Start from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="startDay" [min]="1" [max]="31" [showButtons]="true"></p-inputNumber>
            &nbsp;Day,&nbsp;and every
            <p-inputNumber [(ngModel)]="everyDay" [min]="1" [max]="31" [showButtons]="true"> </p-inputNumber>
            &nbsp;Days to execute once
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="5" [(ngModel)]="daySelect"></p-radioButton>
            The nearest working day on the &nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="perDay" [min]="0" [max]="31" [showButtons]="true"></p-inputNumber>
            &nbsp;&nbsp; of every month
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="6" [(ngModel)]="daySelect"></p-radioButton>
            The last day of the week
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="7" [(ngModel)]="daySelect"></p-radioButton>
            Designated&nbsp;&nbsp;
            <p-multiSelect [options]="designatedsDay!" [(ngModel)]="designatedDay" [maxSelectedLabels]="0" [style]="{ width: '200px' }">
            </p-multiSelect>
            <label *ngIf="!!designatedDay! && !!designatedDay?.length">
              &nbsp;&nbsp;(&nbsp;
              <label *ngFor="let item of designatedDay; let i = index">
                {{ item }}
                <label *ngIf="i != designatedDay?.length! - 1"> &nbsp;,&nbsp; </label>
              </label>
              &nbsp;)&nbsp;&nbsp;
            </label>
          </div>
        </div>
      </p-tabPanel>
      <p-tabPanel header="Month">
        <div class="p-grid">
          <div class="p-col-12">
            <p-radioButton value="1" [(ngModel)]="monthSelect"></p-radioButton>
            <label>Per month ,wildcards allowed [,-* /]</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="2" [(ngModel)]="monthSelect"></p-radioButton>
            <label>Not specify</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="3" [(ngModel)]="monthSelect"></p-radioButton>
            The cycle from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="fromMonth" [min]="1" [max]="toMonth! - 1" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;to&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="toMonth" [min]="fromMonth! + 1" [max]="12" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;months
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="4" [(ngModel)]="monthSelect"></p-radioButton>
            Start from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="startMonth" [min]="1" [max]="12" [showButtons]="true"> </p-inputNumber>
            &nbsp;month,&nbsp;and every
            <p-inputNumber [(ngModel)]="everyMonth" [min]="1" [max]="12" [showButtons]="true"> </p-inputNumber>
            &nbsp;months to execute once
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="5" [(ngModel)]="monthSelect"></p-radioButton>
            Designated&nbsp;&nbsp;
            <p-multiSelect [options]="designatedsMonth!" [(ngModel)]="designatedMonth" [maxSelectedLabels]="0" [style]="{ width: '200px' }">
            </p-multiSelect>
            <label *ngIf="!!designatedMonth! && !!designatedMonth?.length">
              &nbsp;&nbsp;(&nbsp;
              <label *ngFor="let item of designatedMonth; let i = index">
                {{ item }}
                <label *ngIf="i != designatedMonth?.length! - 1"> &nbsp;,&nbsp; </label>
              </label>
              &nbsp;)&nbsp;&nbsp;
            </label>
          </div>
        </div>
      </p-tabPanel>

      <p-tabPanel header="Week" [disabled]="daySelect !== '2'">
        <div class="p-grid">
          <div class="p-col-12">
            <p-radioButton value="1" [(ngModel)]="weekSelect"></p-radioButton>
            <label>Not specify</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="2" [(ngModel)]="weekSelect"></p-radioButton>
            <label>Per week ,wildcards allowed [,-* / L #]</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="3" [(ngModel)]="weekSelect"></p-radioButton>
            The cycle from&nbsp;&nbsp;
            <p-dropdown [options]="dayOfWeeks!" [(ngModel)]="fromWeek"></p-dropdown>
            &nbsp;&nbsp;to&nbsp;&nbsp;
            <p-dropdown [options]="dayOfWeeks!" [(ngModel)]="toWeek"></p-dropdown>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="4" [(ngModel)]="weekSelect"></p-radioButton>
            The&nbsp;&nbsp;
            <p-dropdown [options]="dayOfWeeks!" [(ngModel)]="dayOfWeek"></p-dropdown>
            &nbsp;of the &nbsp;
            <p-dropdown [options]="whichWeeks!" [(ngModel)]="whichWeek"></p-dropdown>
            &nbsp;week
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="5" [(ngModel)]="weekSelect"></p-radioButton>
            The last &nbsp;&nbsp;
            <p-dropdown [options]="dayOfWeeks!" [(ngModel)]="lastDayOfWeek"></p-dropdown>
            &nbsp;of the month
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="6" [(ngModel)]="weekSelect"></p-radioButton>
            Designated&nbsp;&nbsp;
            <p-multiSelect [options]="designatedsWeek!" [(ngModel)]="designatedWeek" [maxSelectedLabels]="0" [style]="{ width: '200px' }">
            </p-multiSelect>
            <label *ngIf="!!designatedWeek! && !!designatedWeek?.length!">
              &nbsp;&nbsp;(&nbsp;
              <label *ngFor="let item of designatedWeek; let i = index">
                {{ getDayOfWeekName(item) }}
                <label *ngIf="i != designatedWeek?.length! - 1"> &nbsp;,&nbsp; </label>
              </label>
              &nbsp;)&nbsp;&nbsp;
            </label>
          </div>
        </div>
      </p-tabPanel>
      <p-tabPanel header="Year">
        <div class="p-grid">
          <div class="p-col-12">
            <p-radioButton value="1" [(ngModel)]="yearSelect"></p-radioButton>
            <label>Not specify</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="2" [(ngModel)]="yearSelect"></p-radioButton>
            <label>Per year ,wildcards allowed [,-* /]</label>
          </div>
          <br />
          <div class="p-col-12">
            <p-radioButton value="3" [(ngModel)]="yearSelect"></p-radioButton>
            The cycle from&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="fromYear" [min]="minYear!" [max]="toYear! - 1" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;to&nbsp;&nbsp;
            <p-inputNumber [(ngModel)]="toYear" [min]="fromYear! + 1" [max]="minYear! + 1000" [showButtons]="true"> </p-inputNumber>
            &nbsp;&nbsp;Year
          </div>
        </div>
      </p-tabPanel>
    </p-tabView>

    <p-card [style]="{ 'margin-top': '20px', padding: '2rem', 'padding-left': '5rem', 'padding-right': '5rem' }">
      <p-header>
        <div class="row no-margin">
          <div class="float-start col-sm-6 no-padding">
            <label class="ui-card-title ng-star-inserted">Cron Result</label>
            <hr />
          </div>
          <div class="float-end col-sm-6 no-padding">
            <label class="ui-card-title ng-star-inserted float-end">Next 6 Running Time</label>
            <br /><br />
            <hr class="float-end" />
          </div>
        </div>
      </p-header>

      <div class="row no-margin">
        <div class="col-sm-5 no-padding middle">
          <input type="text" (change)="getCronRunTime()" name="crons" class="form-control" [(ngModel)]="cron" />
        </div>
        <div class="col-sm-7 no-padding float-end text-end">
          <div *ngIf="!cronValid!; then invaild; else vaild"></div>
          <ng-template #invaild>
            <div>
              <strong class="form-text text-danger read" icTranslate="schedule.validate.cronValid">
                Thr Cron is invaild, please check the cron.
              </strong>
            </div>
          </ng-template>
          <ng-template #vaild>
            <span *ngFor="let item of runTime; let i = index">
              <label class="read">{{ item }}</label>
              <span *ngIf="(i + 1) % 3 === 0; then br; else nbsp"></span>
              <ng-template #br> <br /> </ng-template>
              <ng-template #nbsp> &nbsp;&nbsp; </ng-template>
            </span>
          </ng-template>
        </div>
      </div>
    </p-card>
  </div>
  <p-footer>
    <button type="button" pButton icon="pi pi-check" [disabled]="!cron || !cron.length" (click)="confirmCron()" label="Confirm"></button>
    <button type="button" pButton icon="pi pi-times" (click)="dialogShow = false" label="Cancel" class="ui-button-secondary"></button>
  </p-footer>
</p-dialog>
<p-confirmDialog header="Confirmation" [style]="{ width: '50vw' }" icon="pi pi-exclamation-triangle"></p-confirmDialog>
